def medal_to_points(medal_name):
  point = 0
  if (medal_name) == 'Gold'  :
    point = 3
  if (medal_name) == 'Silver':
    point = 2
  if (medal_name) == 'Bronze': 
    point = 1
  if (medal_name) == 'None'  : 
    point = 0
  return point
